const bgImage = `url('data:image/png;base64,')`;

const foregroundColor = 'rgba(230,30,99,1)';
const backgroundColor = 'rgba(0,0,0,0.8)';

exports.decorateConfig = (config) => {
    return Object.assign({}, config, {
        backgroundColor,
        foregroundColor,
        borderColor: backgroundColor,
        cursorColor: foregroundColor,
        cursorShape: 'UNDERLINE',
        css: `
            ${config.css || ''}
            .header_windowHeader {
                background: ${backgroundColor};
            }
            .header_appTitle {
                color: ${foregroundColor};
                letter-spacing: 2px;
                text-transform: uppercase;
            }
            .header_shape {
                color: ${foregroundColor};
            }
            .terms_terms {
                background: transparent ${bgImage} center right !important;
                background-size: cover !important;
                box-shadow: inset 0 0 6px ${backgroundColor}
            }
        `
    });
};
